VALUES ('8003712009356', 'Avena', 'BEVANDA A BASE DI AVENA. Ingredienti: acqua, *avena (11%), *olio di semi di girasole spremuto a freddo, sale marino. *Prodotto biologico. Può contenere glutine. Conservare in luogo fresco e asciutto. Dopo l\'apertura conservare in frigorifero e consumare entro 3-4 giorni. BEBIDA DE AVENA. Ingredientes: agua, *avena (11%), *aceite de girasol de primera presión en frio, sal marina. *Producto ecológico. Puede contener gluten. Consérvese en lugar fresco y seco. Una vez abierto, conservar en el frigorífico y consumir en 3-4 días. OAT DRINK. Ingredients: water, *oats (11%), cold-pressed sunflower oil, sea salt. *Organic product. May contain gluten. Store in a cool and dry place. After opening keep refrigerated and consume within 3-4 days. BOISSON À BASE D\'AVOINE. Ingrédients: eau, *avoine (11%), *huile de tournesol pressée à froid, sel marin. *Produit biologique. Peut contenir gluten. Conserver dans un endroit sec et frais. Après l\'ouverture, conserver au réfrigérateur et consommer dans les 3-4 jours. HAFERGETRÄNK. Zutaten: Wasser, *Hafer (11%), *kaltgepreßtes Sonnenblumenöl, Meersalz. *Biologisches Produkt. Kann Gluten enthalten. Kühl und trocken lagern. Nach dem öffnen im Kuhlschrank aufbewahren und innerhalb Von 3-4 Tagen aufbrauchen.', 'https://static.openfoodfacts.org/images/products/800/371/200/9356/front_en.3.400.jpg', '1', '0.1', '7', '4.2', '', '0.6', '0.09', '0.0354330708661417', '0', '1');

