VALUES ('8003781370432', 'Panettone crema al limoncello', 'PANETTONE CREMA AL LIMONCELLO PANETTONE FARCITO CON CREMA AL LIMONCELLO, CON SCORZE DI LIMONE CANDITE, SENZA UVETTA. Prodotto dolciario da forno a lievitazione naturale. Ingredienti: farina di frumento, crema di farcitura 14% (zucchero, sciroppo di glucosio, latte intero, liquore Limoncello 10% (acqua , zucchero, alcool, infuso di limoni 10%), acqua, aromi naturali, stabilizzante: pectina), uova fresche, burro, scorze di limone a cubetti e in pasta candite 12% (scorze di limone, sciroppo di glucosio-fruttosio, zucchero, correttore di acidità: acido citrico), zucchero, tuorlo d\'uova fresche, latte, lievito naturale (frumento), emulsionanti: mono e digliceridi degli acidi grassi, sciroppo di glucosio, aromi, burro di cacao, sale. Può contenere frutta a guscio e soia. PANETTONE FILLED WITH LIMONCELLO CREAM, WITH CANDIED LEMON PEELS, WITHOUT SULTANAS. NATURALLY LEAVENED OVEN BAKED PRODUCT. Ingredients: wheat flour, filling cream 14% (sugar, glucose syrup, whole milk, limoncello liqueur 10% (water, sugar, alcohol, lemon infusion 10%), water, natural flavours, jelly agent pectin), eggs, butter, candied lemon peels cubes and paste 12% (lemon peels, glucose-fructose syrup, sugar, acidity regulator: citric acid), sugar, egg yolk, milk, natural yeast (wheat), emulsifiers: mono and diglycerides of fatty acids, glucose syrup, flavourings, cocoa butter, salt. May contain nuts and soy. PANETTONE FARCI AVEC CREME AU LIMONCELLO, AVEC ECORCÉS DE CITRON CONFITES, SANS RAISINS SECS. PRODUIT DE FOUR À LÉVAGE NATUREL Ingrédients: farine de blé, crème de fourrage 14% (sucre, sirop de glucose, lait entier, limoncello liqueur 10% ( eau, sucre, alcool, infusion de citrons 10%), eau, arômes naturels, gélifiant: pectine), oeufs frais, beurre, écorces de citron confites en cubes et en pâte 12% (écorces de citron, sirop de glucose requlateur d\'acidité: acide citrique), sucre, jaune d\'oeufs frais, lait, levain naturel (blé), émulsifiants: mono et diglycérides d\'acides gras, sirop de glucose, arômes, beurre de cacao, sel. Peut contenir fruits à coque et de soja. PANETTONE MIT LIMONCELLO FÜLLUNGSCREME UND KANDIERTE ZITRONEN SCHALEN, OHNE ROSINEN. HEFEGEBACK. Zutaten: Weizenmehl, Füllungscreme 14% (Zucker, Glukose Sirup, VollMilch, Limoncello Schnaps 10% ( Wasser, Zucker, Alkohol, Zitronenaufguss 10%) Wasser, natürliche Aromastoffe, Geliermittel: Pektin), frische Eier, Butter, kandierte Zitronen Schalen und Teig 12% (Zitronen Schalen, Glukose-Fructose Sirup, Zucker, Säureregulator: Zitronensäure), Zucker, frischen Eidotter, Milch, Hefe (Weizen), Emulgatoren: Mono und Diglyzeride der Speisefettsäuren, Glukose Sirup. Aromastoffe, Kakaobutter, Salz. Kann Nüssen und Soja enthalten fructose, sucre,', 'https://static.openfoodfacts.org/images/products/800/378/137/0432/front_en.4.400.jpg', '', '', '', '', '', '', '', '', '', '1');

