VALUES ('8003892002031', 'Tortelli di zucca', 'INGREDIENTI PASTA:(50%) Farina di _grano_ tenero “00” (contiene _glutine_), semola di _grano_ duro (contiene _glutine_), _uova_ 20%, acqua, sale alimentare aggiunto max 2%. INGREDIENTI RIPIENO: (50%) Polpa di zucca 65%, granella di amaretti 13% (zucchero, mandorle di albicocche, albume d’_uovo_ (uovo), lattosio e proteine del latte (_latte_), aromi, agente lievitante: carbonato acido di sodio), pangrattato (farina di grano tenero tipo “0” (contiene _glutine_), lievito di birra, sale), formaggio Parmigiano Reggiano (_latte_, sale, caglio), formaggio Monterigo (_latte_, sale, fermenti lattici, caglio microbico), sale, noce moscata.', 'https://static.openfoodfacts.org/images/products/800/389/200/2031/front_it.7.400.jpg', '3.6', '1.4', '36', '6.4', '1.8', '8.6', '1.4', '0.551181102362205', '', '0');

