VALUES ('8003938006498', 'Bonta\' Forêt Noire (2+1 gratis)', 'eau, _crème_ fraîche 19,2 %, sirop de glucose, sucre, pièces de cerises 9,5 %, _lait_ écrémé en poudre, _œufs_, farine de _blé_, sirop de glucose-fructose, éclats de chocolat noir [sucre, pâte de cacao, cacao maigre, beurre de cacao, émulsifiant : lécithines (_soja_)], alcool, purée de cerise 1,1 %, amidon de maïs, émulsifiant : mono- et diglycérides d\'acides gras, cacao 0,5 %, fibre végétale, épaississant : carraghénanes, stabilisants : sorbitols, pectines, fécule de pomme de terre, arômes naturels, poudre à lever : diphosphates - carbonates de sodium, cacao maigre 0,1 %, correcteurs d\'acidité : acide citrique - citrates de sodium, conservateur : sorbate de potassium.', 'https://static.openfoodfacts.org/images/products/800/393/800/6498/front_fr.6.400.jpg', '8.3', '5.5', '34', '24.4', '1.8', '3.9', '0.18', '0.0708661417322834', '1.2', '0');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('8003938006504', 'Bonta Al', 'lait écrémé en poudre réhydraté, sirop de glucose, crème fraîche 14,5%, chocolat en poudre 5,4% (sucre, cacao 1,73%), huiles végétales (coco et tournesol), sucre, lait écrémé en poudre, eau, beurre de cacao, farine de blé stabilisant: sorbitols, cacao maigre 1,5% (0,2% dans le biscuit au cacao maigre), chocolat au lait 1,3% (sucre, beurre de cacao, hit entier en poudre, pâte de cacao, lactosérum lactose, émulsifiant: lécithines (soja)), alcool, chocolat noir 1% (pâte de cacao, sucre, cacao maigre, beurre de cacao, émulsifiant: lécithines (soja), gousses de vanille), gélatine, émulsifiants: esters lactiques des mono- et diglycérides d\'acides gras - mono- et diglycérides d\'acides gras, œuf entier en poudre, épaississants: carraghénanes - gomme xanthane - gomme guar - farine de graines de caroube, amidon de maïs, arômes naturels, sel, poudres à lever: carbonates de sodium - carbonates d\'ammonium, sirop de sucre inverti, lactosérum, maltodextrine, miel, amidon de tapioca, agent d\'enrobage.\' gomme arabique, sirop de riz. Teneur en alcool 1,2%. Allergènes: voir ingrédients soulignés. Traces éventuelles de fruits à coques et d\'arachides. Sans ajout de colorants ni conservateurs. A conserver au réfrigérateur (OOC et +70C).', 'https://static.openfoodfacts.org/images/products/800/393/800/6504/front_fr.4.400.jpg', '14.7', '10.6', '29.7', '21.2', '3.1', '4.6', '0.18', '0.0708661417322835', '', '1');

